<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="utf-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Diabetes Prediction</title>
  <!-- Bootstrap CSS CDN -->
  <link href="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/css/bootstrap.min.css" rel="stylesheet">
  <style>
    body {
      background: linear-gradient(135deg, #f8f4e5 0%, #ffa580 100%);
      min-height: 100vh;
      display: flex;
      align-items: center;
      justify-content: center;
    }
    .enterprise-card {
      background: #fff;
      border-radius: 18px;
      box-shadow: 0 8px 32px 0 rgba(31, 38, 135, 0.15);
      padding: 36px 32px 28px 32px;
      min-width: 340px;
      max-width: 420px;
      width: 100%;
    }
    .form-label {
      font-weight: 600;
    }
    .form-control:focus {
      border-color: #ffa580;
      box-shadow: 0 0 0 0.2rem rgba(255,165,128,.25);
    }
    .btn-primary {
      background: linear-gradient(90deg, #ffa580 0%, #95a4ff 100%);
      border: none;
    }
    .btn-primary:hover {
      background: linear-gradient(90deg, #95a4ff 0%, #ffa580 100%);
    }
    .logo {
      width: 60px;
      margin-bottom: 10px;
    }
  </style>
</head>
<body>
  <div class="enterprise-card">
    <div class="text-center mb-4">
      <img src="https://cdn-icons-png.flaticon.com/512/2965/2965567.png" alt="Logo" class="logo">
      <h1 class="h3 mb-3 fw-bold">Diabetes Prediction</h1>
      <p class="text-muted">Enterprise Health Analytics</p>
    </div>
    <form id="diabetes-prediction-form" action="{% url 'predict' %}" method="post">
      {% csrf_token %}
      <div class="mb-3">
        <label for="gender" class="form-label">Gender</label>
        <select class="form-select" name="gender" required>
          <option value="">Select...</option>
          <option value="0">Male</option>
          <option value="1">Female</option>
        </select>
      </div>
      <div class="mb-3">
        <label for="age" class="form-label">Age</label>
        <input type="number" class="form-control" name="age" required min="0" max="120">
      </div>
      <div class="mb-3">
        <label for="hypertension" class="form-label">Hypertension</label>
        <select class="form-select" name="hypertension" required>
          <option value="">Select...</option>
          <option value="0">No</option>
          <option value="1">Yes</option>
        </select>
      </div>
      <div class="mb-3">
        <label for="heart_disease" class="form-label">Heart Disease</label>
        <select class="form-select" name="heart_disease" required>
          <option value="">Select...</option>
          <option value="0">No</option>
          <option value="1">Yes</option>
        </select>
      </div>
      <div class="mb-3">
        <label for="smoking_history" class="form-label">Smoking History</label>
        <select class="form-select" name="smoking_history" required>
          <option value="">Select...</option>
          <option value="0">Never</option>
          <option value="1">No Info</option>
          <option value="2">Former</option>
          <option value="3">Current</option>
          <option value="4">Ever</option>
        </select>
      </div>
      <div class="mb-3">
        <label for="bmi" class="form-label">BMI</label>
        <input type="number" step="0.01" class="form-control" name="bmi" required>
      </div>
      <div class="mb-3">
        <label for="HbA1c_level" class="form-label">HbA1c Level</label>
        <input type="number" step="0.1" class="form-control" name="HbA1c_level" required>
      </div>
      <div class="mb-3">
        <label for="blood_glucose_level" class="form-label">Blood Glucose Level</label>
        <input type="number" class="form-control" name="blood_glucose_level" required>
      </div>
      <button type="submit" class="btn btn-primary w-100">Predict</button>
    </form>
    <footer class="mt-4 text-center text-muted" style="font-size: 0.9em;">
      &copy; 2024 Enterprise Diabetes Predictor
    </footer>
  </div>
  <!-- Bootstrap JS CDN (optional, for dropdowns etc.) -->
  <script src="https://cdn.jsdelivr.net/npm/bootstrap@5.3.0/dist/js/bootstrap.bundle.min.js"></script>
</body>
